How to merge result from $lookup with subdocuments<p>Consider the following toy example:</p>

<p>Collection <code>shops</code></p>

<pre class="lang-js prettyprint-override"><code>{
  "products": [
    { id: "abc", price: 20.5 },
    { id: "abd", price: 34.0 }
  ]
}
</code></pre>

<p>Collection <code>products</code></p>

<pre class="lang-js prettyprint-override"><code>{
  _id: "abc",
  name: "Apple"
}
</code></pre>

<p>Running the following query...</p>

<pre class="lang-js prettyprint-override"><code>db.shops.aggregate([
  {
    $lookup: {
      from: "products",
      localField: "products.id",
      foreignField: "_id",
      as: "product_info"
    }
  }
])
</code></pre>

<p>returns...</p>

<pre class="lang-js prettyprint-override"><code>[{
  "products": [
    { id: "abc", price: 20.5 },
    { id: "abd", price: 34.0 }
  ],
  "product_info": [
    { _id: "abc", name: "Apple" },
    { _id: "abd", name: "Orange" }

  ]
}]
</code></pre>

<p>Is there a way to "merge" <code>products</code> and <code>product_info</code> to get the following?</p>

<pre class="lang-js prettyprint-override"><code>[{
  "products": [
    { id: "abc", price: 20.5, name: "Apple" },
    { id: "abd", price: 34.0, name: "Orange" }
  ],
}]
</code></pre>

<p>Thanks for your help!</p>

