MongoDB return document as instanciated class in PHP<p>Given a PHP class MyClass:</p>

<pre><code>class MyClass {
   private $a;
   private $b;

   function doSomething() {
      return $this-&gt;a + $this-&gt;b;
   }
}
</code></pre>

<p>Can I create an instance of that class with the result array returned by MongoDB without assigning each value to the class manually? The array has the exact same keys (a and b). Currently, I use the following time-consuming approach:</p>

<pre><code>$result = $mongo-&gt;findOne(array('key' =&gt; 'value'));
$myClass = new MyClass();
$myClass-&gt;a = $result['a'];
$myClass-&gt;b = $result['b'];
</code></pre>

