How to verify if array contains sequential items on MongoDB?<p>If I have a document on Mongo with the following structure, how do I verify if <code>data</code> array contains two or more properties with the same value, one after the other?</p>

<p>In this case, my goals is to point out that among all documents on a collection, this one have two statuses with the same value ("status_B").</p>

<p>I know how to count how many times a status occurs on <code>data</code> array, but I need to find in which documents two or more status occur sequentially.</p>

<pre><code>{
    "_id": ObjectId("XYZ"),
    "data": [
        {
            "status": "status_A",
            "other": "data"
        },
        {
            "status": "status_B",
            "other": "data"
        },
        {
            "status": "status_B",
            "other": "data"
        }
    ]
}
</code></pre>

