MongoJsonSchema.builder() does not generate SchemaMap with same specification as MongoDB CSFLE extended JSON Schema<p>I am trying to implement Automatic Client-Side Field Level Encryption (CSFLE) in MongoDB (Enterprize Edition). The steps provided in <a href="https://docs.mongodb.com/drivers/use-cases/client-side-field-level-encryption-guide" rel="nofollow noreferrer">MongoDB Docs</a> work perfectly fine. However, <code>spring-data-mongodb</code> provides a way to generate $jsonSchema using MongoJsonSchema.builder() class to avoid writing the schema in raw JSON.</p>

<p>The problem that I am facing is that the schema generated by <code>MongoJsonSchem.builder()</code> differs from the specification mentioned and the example provided in MongoDB Docs <a href="https://raw.githubusercontent.com/mongodb/docs-assets/DOCSP-json-schema-helper-and-json/MedcoMDSchema.json" rel="nofollow noreferrer">here</a>.
To be specific, the example has </p>

<pre><code>"keyId": [
      {
        "$binary": {
          "base64": "&lt;paste_your_key_id_here&gt;",
          "subType": "04"
        }
      }
    ]
</code></pre>

<p>but the schema generated by builder has</p>

<pre><code>"keyId": [
            {
              "$binary": "&lt;base64 encoded uuid&gt;",
              "$type": "03"
            }
          ]
</code></pre>

<p>The execution fails only because the format of the key is not what the driver expects.</p>

<p>Unfortunately, the <code>EncryptedJsonSchemaProperty</code> only has <code>keyId()</code> that accepts a string and a <code>keys()</code> that accepts an array of UUIDs. Both of the methods generate schema that doesn't match with the example.</p>

<p>Is there anything that I am missing or is the builder not meant to be used to generate a <code>SchemaMap</code> that could be supplied to <code>AutoEncryptionSettings</code> as yet.</p>

