<p><strong>REACT: Reducer</strong></p>

<pre><code>import { FETCHING, SUCCESS, ERROR } from '../actions/actionTypes';

export const initialState = {
  status: '',
  data: [],
};

const appReducer = (state, { type, response } = {}) =&gt; {
  switch (type) {
    case FETCHING:
      return { ...initialState, status: FETCHING };
    case SUCCESS:
      return { ...initialState, status: SUCCESS, data: response };
    case ERROR:
      return { ...initialState, status: ERROR, data: response };
    default:
      return state;
  }
};

export default appReducer;
</code></pre>

<p><strong>Action types:</strong></p>

<pre><code>export const FETCHING = 'FETCHING';
export const SUCCESS = 'SUCCESS';
export const ERROR = 'ERROR';

/* Action Creators */
export const fetching = () =&gt; ({ type: FETCHING });
export const success = (response) =&gt; ({ type: SUCCESS, response });
export const error = (response) =&gt; ({ type: ERROR, response });
</code></pre>

<p><strong>Custom Hook that is loaded into context provider:</strong></p>

<pre><code>import { useCallback, useReducer } from 'react';
import appReducer, { initialState } from '../reducers/reducer';
import { fetching, success, error } from '../actions/actionTypes';
import axios from 'axios';

const useApiRequest = (params) =&gt; {
  const [state, dispatch] = useReducer(appReducer, initialState);

  const getRequest = useCallback(async () =&gt; {
    dispatch(fetching());
    try {
      const response = await axios({ method: 'get', url: '/list' });
      dispatch(success(response.data));
    } catch (e) {
      dispatch(error(e));
    }
  }, []);

  const postRequest = useCallback(async () =&gt; {
    dispatch(fetching());
    try {
      const response = await axios({
        method: 'post',
        url: '/list/add',
        params,
      });
      dispatch(success(response.data));
    } catch (e) {
      dispatch(error(e));
    }
  }, [params]);

  const patchUpdateRequest = useCallback(async () =&gt; {
    dispatch(fetching());
    try {
      const response = await axios({
        method: 'patch',
        url: '/edit/title/:id',
        params,
      });
      dispatch(success(response.data));
    } catch (e) {
      dispatch(error(e));
    }
  }, [params]);

  const putUpdateRequest = useCallback(async () =&gt; {
    dispatch(fetching());
    try {
      const response = await axios({
        method: 'put',
        url: '/edit/items/:id',
        params,
      });
      dispatch(success(response.data));
    } catch (e) {
      dispatch(error(e));
    }
  }, [params]);

  const deleteRequest = useCallback(async () =&gt; {
    dispatch(fetching());
    try {
      const response = await axios({
        method: 'delete',
        url: '/delete/:id',
        params,
      });
      dispatch(success(response.data));
    } catch (e) {
      dispatch(error(e));
    }
  }, [params]);

  return [
    state,
    getRequest,
    postRequest,
    patchUpdateRequest,
    putUpdateRequest,
    deleteRequest,
  ];
};

export default useApiRequest;
</code></pre>

<p><strong>Context Provider:</strong></p>

<pre><code>import React, { createContext } from 'react';
import useApiRequest from '../custom-hooks/useApiRequest';

const AppContext = createContext();

export const AppcontextProvider = (props) =&gt; {
  const [
    state,
    getRequest,
    postRequest,
    patchUpdateRequest,
    putUpdateRequest,
    deleteRequest,
  ] = useApiRequest({});

  return (
    &lt;AppContext.Provider
      value={{
        state,
        getRequest,
        postRequest,
        patchUpdateRequest,
        putUpdateRequest,
        deleteRequest,
      }}
    &gt;
      {props.children}
    &lt;/AppContext.Provider&gt;
  );
};

export default AppContext;
</code></pre>

<p><strong>App enclosed with the context provider:</strong></p>

<pre><code>import React from 'react';
import Header from './components/header/Header';
import Main from './components/main/Main';
import { AppcontextProvider } from './context/AppContext';
import './stylesheets/index.scss';

function App() {
  return (
    &lt;AppcontextProvider&gt;
      &lt;div className='App'&gt;
        &lt;Header /&gt;
        &lt;Main /&gt;
      &lt;/div&gt;
    &lt;/AppcontextProvider&gt;
  );
}

export default App;
</code></pre>

