<p><strong>Modal for posting new list:</strong></p>

<pre><code>import React, { useContext, useEffect, useState, useRef } from 'react';
import AppContext from '../../context/AppContext';

const AddList = ({ exitHandler }) =&gt; {
  const { postRequest } = useContext(AppContext);
  const [newList, setNewList] = useState({});
  const inputRef = useRef(null);

  /* On load set focus on the input */
  useEffect(() =&gt; {
    inputRef.current.focus();
  }, []);

  const handleAddList = (e) =&gt; {
    e.preventDefault();
    const new_list = {
      list_name: inputRef.current.value,
      list_items: [],
    };
    setNewList(new_list);
  };

  const handleSubmit = (e) =&gt; {
    e.preventDefault();
    postRequest(newList);
    exitHandler();
  };

  return (
    &lt;form onSubmit={handleSubmit} className='generic-form'&gt;
      &lt;input
        type='text'
        ref={inputRef}
        placeholder='List Name'
        onChange={handleAddList}
      /&gt;
      &lt;input type='submit' value='ADD' className='btn-rec' /&gt;
    &lt;/form&gt;
  );
};

export default AddList;
